import React, {useState} from "react";
function App() {
  const[count,setCount]=useState(0)
  return (
    <div className="container">
      <div className="card text-center my-5">
        <div className="card-body">
          <h1 className="counter">Counter App</h1>
          <div className="my-5">
            <h2 className="my-0"> {count}</h2>
              <button className="btn-incre" onClick={()=> setCount(count+1)}>Increment</button>
              <button className="btn-decre" onClick={()=> setCount(count-1)}>Decrement</button>
              <button className="btn-reject" onClick={()=>setCount(0)}>Reject</button>
          </div>
        </div>
      </div>
    </div>
  );
}
export default App;
